import React from 'react';
import 'axios';
import Axios from 'axios';

const proxyUrl = "https://cors-anywhere.herokuapp.com/";
const url = "https://us-central1-project-share-8df06.cloudfunctions.net/api/getHome"

class AxiosTutorial extends React.Component {
    state = {
        posts: []
    }

    constructor() {
        super();
        fetch(proxyUrl + url)
        .then(response => response.json())
        .then(data => console.log(data));
    }

    render() {
        return (
            <div>
                Hello
            </div>
        )
    }
};

export default AxiosTutorial;
